        <p>Với một người có tâm hồn bay bổng và đầu óc sáng tạo như tác giả blog Code dạo thì cái thứ quái gì cũng có thể biến thành bài viết được.</p>
        <p>Hôm nay khi mình đang ngồi đọc sách dưới tán cây thì bỗng… một quả sầu riêng nặng nửa kg rơi trúng đầu. Nhờ vậy mà mình mới <b>nảy ra cảm hứng viết series này</b>. Tên đầy đủ của series là <b>Từ Chuyện Code Ngẫm Chuyện Đời</b>, do hơi dài nên mình rút gọn lại thành <b>Chuyện Code Chuyện Đời</b> cho dễ đọc dễ nhớ!</p>
        <p>Trong quá trình học và đi làm, đôi khi ta học được nhiều kĩ thuật lập trình, thuật toán và các nguyên lý rất hay ho. Khi quả sầu riêng rơi vào đầu, mình chợt ngộ ra rằng: những");
            WriteLiteral(@" kĩ thuật cũng như nguyên lý này không chỉ áp dụng được trong code mà còn có thể <b>áp dụng vào đời sống</b>.</p>
        <p>Series Chuyện Code Chuyện Đời ra đời từ đó. Bài viết đầu tiên trong series sẽ nói về chuyện optimize (tối ưu hoá) code và optimize cuộc sống.</p>
        <h2>Optimize code là gì?</h2>
        <p>Optimize code là một trong những kĩ năng quan trọng của developer. Mình từng có một bài viết về optimize code, tầm quan trọng của nó cũng phân tích những trường hợp <b>nên và không nên optimize code</b>. Các bạn có thể xem lại ở đây: https://toidicodedao.com/2016/09/27/optimize-code/</p>
        <pre>Optimize code (Tối ưu code) là việc<strong> chỉnh sửa/viết lại code</strong> nhằm giảm dung lượng, hạn chế input/output, tăng tốc độ thực thi, giảm lượng phần cứng cần sử dụng.</pre>
        <p>Ngày nay, công nghệ phát triển, đến điện thoại di động cũng có bộ nhớ 4GB, vi xử lý vài GHz, code không có optimize thì <b>vẫn chạy vù vù</b>. Tuy nhiên, ngày xưa, các hệ thống máy tính còn chậm, RAM và ");
