        <p>Tại sao lại phải optimize code? Optimize code giúp tăng tốc độ thực thi hoặc giảm lượng phần cứng (RAM, ổ cứng) sử dụng. Khi hệ thống chạy quá chậm, hoặc tốn quá nhiều tài nguyên, ta phải tối ưu để giúp hệ thống <b>chạy nhanh hơn</b> hoặc <b>tốn ít tài nguyên hơn</b>.</p>\
