        <h2>Từ optimize code đến optimize cuộc sống</h2>
        <p>Hãy thử tưởng tượng cuộc sống của bạn là một chiếc máy tính; xem thời gian bạn có là tốc độ xử lý; tiền bạc bạn có chính là RAM; sức khoẻ chính là ổ cứng.</p>
