        <p>Trong lập trình, để code chạy nhanh, ta cần phải lựa chọn thuật toán phù hợp với vấn đề cần giải quyết. Trong cuộc sống cũng thế, để không phí tổn thời gian, hãy dùng nó để làm những việc có ích!</p>
        <p>Lấy ví dụ, ngày nào bạn cũng bỏ ra 3 tiếng để online Facebook và ngắm gái xinh, vô cùng lãng phí. Thay vào đó, hãy thử bỏ ra 1 tiếng để đọc Medium, 1 tiếng để đọc Quora, lướt Facebook thôi. Thời gian bỏ ra tương đương, nhưng những điều có ích bạn thu được sẽ nhiều hơn gấp mấy lần.</p>
        <p>Một ví dụ khác về tiền bạc. Bạn làm được gì với <<b>160k</b>? Có thể bạn sẽ mua được 10 ổ bánh mì hoặc một hai chầu nhậu. Chúng chỉ giúp bạn vơi đi cơn đói chứ không có giá trị trong tương lai.</p>
        <p>Thay vào đó, nếu bạn bỏ 160k ra mua “Code dạo kí sự“, cuốn sách sắp ra mắt của <b>Tôi đi code dạo</b>, bạn sẽ thu được những điều bổ ích sau:</p>
